import React from "react";
import { BrowserRouter as Router, Link } from "react-router-dom";
import "./NavBar.css";

const NavBar = () => {
  return (
    <Router>
      <div className="navbar-wrapper">
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/shop">Shop</Link>
          </li>
          <li>
            <Link to="../../Pages/Cart.js">Cart</Link>
          </li>
        </ul>
      </div>
    </Router>
  );
};

export default NavBar;
